        [Test]
        public void CssTransform_Ensure_Inline_Images_Retained_2()
        {
            //refer to this:http://clientdependency.codeplex.com/workitem/13203

            var cssWithImage = @"body {
    font-size: .85em;
    font-family: 'Trebuchet MS', Verdana, Helvetica, Sans-Serif;
    margin: 0;
    padding: 0;
    color: #696969;
